import React from "react";
import Styles from "./UI/styles.module.css";
import { MoreHandlerClick, ToDoProps } from "../../widgets/ToDoList/ToDoList";
import { ToDoDateComplete, ToDoId } from "../../app/store";

export function ToDoComponent(props:ToDoProps) {
	const id:ToDoId = props.id;
	const dateComplete:ToDoDateComplete = `${props.dateComplete}`;
	const handlerClick: MoreHandlerClick = props.moreHandlerClick;

	return (
		<div className={Styles.container} onClick={() => handlerClick(id)}>
			<div>
				<div className={Styles.toDoTitleContainer}>
					<label htmlFor="ToDoTitle" className={Styles.toDoIdLabel}>{`${props.idInList}.`}&nbsp;</label>
					<h3 id="ToDoTitle" className={Styles.toDoH3}>{props.title}</h3>
				</div>
				<p className={Styles.toDoP}>{props.description}</p>
			</div>
			<button onClick={():void => props.funcDelete(id, dateComplete)} className={Styles.deleteToDoButton}>Удалить</button>
		</div>
	);
}
